apiVersion: v1
items:
- apiVersion: v1
  kind: Service
  metadata:
    labels:
      app.kubernetes.io/name: ingress-nginx
      app.kubernetes.io/part-of: ingress-nginx
    name: ingress-nginx
    namespace: ingress-nginx
  spec:
    ports:
    - name: http
      nodePort: 32688
      port: 80
      protocol: TCP
      targetPort: 80
    - name: https
      nodePort: 31283
      port: 443
      protocol: TCP
      targetPort: 443
    type: NodePort
